import React from "react";
import "./App.css";
// import Commento from "./Commento.js";
import Logo from './Logo.js';
import Expenso from './Expenso.js';
import Empl from './Empl.js';
import Commento from './'
function Projects() {
  return (
    <div className="outer">
        <h1>Project Porfolio</h1>
        <h3 className="checkout">Feel free to click on the project logos to be redirected to the respective projects.</h3>

        <Expenso/>
        <Empl/>
        <Logo 
        link="/projects/commento"
        image="./images/commento_logo.png"
        title="Commento logo"
        category="Google chrome extension"
        />

        <Logo 
        link="/projects/expenso"
        image="./images/commento_logo.png"
        title="Expenso logo"
        category="React website"
        />

        <Logo 
        link="/projects/employee_API"
        image="./images/commento_logo.png"
        title="Employee logo"
        category="REST_API"
        />

    </div>
  )
}

export default Projects;
